101.body:
Para que un elemento flote y los adyacentes lo envuelvan se utiliza float (y clear): &lt;body&gt;
&lt;section class="contenedor"&gt; &lt;aside class="flota"&gt;&lt;/aside&gt; &lt;p&gt;Este 1er párrafo está envolviendo al elemento verde que flota a a la izquierda. Si quisiéramos que flotara a la derecha habría que usar &lt;code&gt;float: right;&lt;/code&gt;.&lt;/p&gt; &lt;p id="p2"&gt;Este 2do párrafo también envuelve al elemento flotante. Si no quisieramos que flotara, habría que poner a este elemento la propiedad CSS &lt;code&gt;clear: both;&lt;/code&gt;.&lt;/p&gt;
&lt;/section&gt;
&lt;/body&gt;
.flota { float: left; width: 80px; height: 140px; background-color: green; margin-right: 10px; margin-bottom: 10px;
}
.contenedor { width: 280px; border: 5px solid gray; padding: 10px; margin: 18px 0 0 10px;
}
#p2 { /* clear: both; */
}
p { margin: 0 0 10px 0; font: 15px sans-serif;
}

102.body:
El elemento se puede posicionar estableciendo la distancia a alguno de los lados (top, right, bottom y/o left) de la referencia indicada en su propiedad position: &lt;body&gt;
&lt;section class="contenedor"&gt; &lt;aside class="posicionado"&gt;&lt;/aside&gt; &lt;p&gt;La propiedad &lt;code&gt;position: relative;&lt;/code&gt; permite mover el elemento respecto de la posición en la que hubiera estado originalmente. Los elementos adyacentes no responden a la nueva posición, solo al hueco original en el que hubiera estado el elemento.&lt;/p&gt; &lt;p&gt;Por el contrario, usando &lt;code&gt;position: absolute;&lt;/code&gt;, los elementos adyacentes ignoran al elemento por completo colocándose como si no existiera. En este caso, el elemento se posiciona respecto al contenedor (si éste tiene un valor de &lt;code&gt;position: relative;&lt;/code&gt;) o respecto a la ventana.&lt;/p&gt; &lt;p&gt;&lt;code&gt;position: fixed;&lt;/code&gt; es similar al anterior pero en este caso lo fijamos a la ventana de modo que siempre permanece visible incluso al hacer scroll.&lt;/p&gt;
&lt;/section&gt;
&lt;/body&gt;
.posicionado { width: 80px; height: 140px; background-color: green; z-index: -1; position: relative; top: 10px; left: 10px;
}
.contenedor { width: 280px; border: 5px dashed gray; padding: 10px; margin: 18px 0 0 10px;
}
p { margin: 0 0 10px 0; font: 15px sans-serif;
} Cambia el CSS del elemento verde para que use una posición absoluta. Cambia el CSS del contenedor para que tenga una posición relativa. Cambia el CSS del elemento verde para que use una posición fija y haz scroll. Quita la propiedad z-index del elemento verde. ⁉️ Ejercicio: Para cada uno de los casos anteriores, identifica el punto de referencia utilizado para recolocar el elemento verde. Explica qué hace la propiedad eliminada en el último punto.

105.body:
Con Flexbox podemos colocar los elementos con respecto a una de las dimensiones (la horizontal o la vertical), y a lo largo de esa dimensión controlar la proporción que ocupa cada elemento [1] . Para ello se utiliza la propiedad flex: flex-grow flex-shrink flex-basis; en los elementos de un contenedor con display: flex: flex-grow: indica en qué proporción crecerá el elemento respecto del resto cuando sobre espacio. flex-shrink: indica en qué proporción encogerá el elemento respecto del resto cuando falte espacio. flex-basis: indica el tamaño inicial para el elemento antes de redistribuir el espacio. &lt;body&gt;
&lt;nav&gt; &lt;ul class="contenedor"&gt; &lt;li&gt;&lt;a href="#"&gt;Inicio&lt;/a&gt;&lt;/li&gt; &lt;li&gt;&lt;a href="#"&gt;Nosotros&lt;/a&gt;&lt;/li&gt; &lt;li&gt;&lt;a href="#"&gt;Productos&lt;/a&gt;&lt;/li&gt; &lt;li&gt;&lt;a href="#"&gt;Contacto&lt;/a&gt;&lt;/li&gt; &lt;/ul&gt;
&lt;/nav&gt;
&lt;/body&gt;
.contenedor { display: flex; list-style: none; margin: 0; background: dodgerblue; padding: 0;
}
.contenedor li { flex: 0 1 0;
}
.contenedor li:first-child {
}
.contenedor a { font: 9px sans-serif; text-align: center; text-decoration: none; display: block; padding: 9px; color: white; user-select: none;
}
.contenedor li:hover { background: royalblue;
} Para cambiar la dimensión sobre la que se distribuyen los elementos usa flex-direction: column; en el contenedor [2] . Deshaz el paso anterior y añade justify-content: center; al contenedor para centrar los elementos. Los elementos no están ocupando todo el espacio disponible en la dimensión horizontal porque tienen un valor de flex-grow igual a 0. Cambia el valor a 1 en la propiedad flex para que crezcan todos con la misma proporción. Si, por ejemplo, quisiéramos que ocupara 4 veces más "Inicio" usaríamos flex: 4 1 0;. Añade esa propiedad al primer elemento. Para simular una situación en la que se encoge el elemento, podemos poner un tamaño inicial grande al resto: usa flex: 1 4 0; en el primero y flex: 1 1 180px; en el resto. ⁉️ Ejercicio: Comprueba visualmente que encoger 4 veces el primer elemento es igual a hacer 4 veces más grande el resto de elementos.

106.body:
Para diseños que requieren colocar elementos en ambas dimensiones es más sencillo utilizar Grid . Se trata de colocar los elementos en la cuadrícula definida en el contenedor. El tamaño de las filas y columnas se puede definir proporcionalmente al espacio disponible con la unidad fr. Existen muchas formas de definir la cuadrícula, a continuación vemos un ejemplo que utiliza nombres de áreas. &lt;body&gt; &lt;header class="cabecera"&gt;Cabecera&lt;/header&gt; &lt;article class="contenido"&gt;Contenido&lt;/article&gt; &lt;aside class="secciones"&gt;Secciones del sitio web&lt;/aside&gt; &lt;aside class="indice"&gt;Índice del contenido&lt;/aside&gt; &lt;footer class="pie"&gt;Pié de página&lt;/footer&gt;
&lt;/body&gt; body { display: grid; grid-template-columns: 2fr 3fr 1fr; grid-template-areas: "header header header" "sections main main" "footer footer footer"; gap: 7px; padding: 12px; text-align: center; font: 12px sans-serif;
}
body * { padding: 10px;
}
.cabecera { background: tomato; grid-area: header;
}
.pie { background: lightgreen; grid-area: footer;
}
.contenido { text-align: left; background: deepskyblue; grid-area: main;
}
.secciones { background: gold; grid-area: sections;
}
.indice { background: hotpink; grid-area: index; display: none;
} ⁉️ Ejercicio: Estudia la CSS y el diseño para añadir un índice a la derecha del contenido. Usar tamaños fijos no ayuda a adaptar el contenido a diferentes tamaños de pantalla. Usando proporciones podremos encoger o crecer en función del espacio disponible en cada pantalla. Si no se indica, se utiliza por defecto la dimensión horizontal flex-direction: row;.

110.body:
Utilizar dimensiones fijas (píxeles) no suele ser conveniente cuando la página pueda verse en pantallas de muy diferente resolución. En su lugar se recomienda usar unidades relativas para definir los tamaños de la letra, los márgenes, paddings, anchos y/o altos del elemento. Las más utilizadas [1] son las relativas al tamaño de la tipografía del navegador [2] : rem, relativa al tamaño de la letra inicial de la página, y em, relativa al tamaño de la letra en el elemento. &lt;body&gt;
&lt;section class="container"&gt; &lt;aside class="flota"&gt;&lt;/aside&gt; &lt;p&gt;Este contenedor está utilizando unidades &lt;strong&gt;rem&lt;/strong&gt; para definir los tamaños de letras, márgenes, paddings, altos y anchos.&lt;/p&gt; &lt;p&gt;Si cambiamos el tamaño de la fuente, este contenedor modifica sus tamaños en la misma proporción. Cuando esta página se vea en pantallas grandes seguirá el tamaño de fuente configurado en el dispositivo que tendrá un valor razonable para su legibilidad. Lo mismo ocurrirá con pantallas más pequeñas que la actual.&lt;/p&gt;
&lt;/section&gt;
&lt;section class="pixels"&gt; &lt;aside class="flota"&gt;&lt;/aside&gt; &lt;p&gt;Este contenedor está utilizando unidades de &lt;strong&gt;píxeles&lt;/strong&gt; para definir los tamaños de letras, márgenes, paddings, altos y anchos.&lt;/p&gt; &lt;p&gt;Si cambiamos el tamaño de la fuente, este contenedor permanece igual con las mismas dimensiones. Eso puede ser interesante cuando se diseña la página para una resolución fija. Pero si esta página se viera en una TV 4K este texto casi no se vería. Y si la página se viera en una pantalla pequeña puede que el texto fuera muy grande y fuera necesario scroll horizontal.&lt;/p&gt;
&lt;/section&gt;
&lt;/body&gt; html { font-family: sans-serif; font-size: 100%;
}
.container .flota { float: left; width: 5rem; height: 9rem; background-color: green; margin-right: 1rem; margin-bottom: 1rem;
}
.container { width: 20rem; border: 5px solid gray; padding: 1rem; margin: 1rem;
}
.container p { margin: 0 0 1rem 0;
}
.pixels .flota { float: left; width: 80px; height: 144px; background-color: green; margin-right: 16px; margin-bottom: 16px;
}
.pixels { width: 320px; border: 5px solid gray; padding: 16px; margin: 16px;
}
.pixels p { margin: 0 0 16px 0; font-size: 16px;
} Para simular los diferentes tamaños de fuente que puedan tener los navegadores de diferentes dispositivos, podemos cambiar el font-size del HTML. Ahora está al 100%, lo que indica que se está usando el valor por defecto de este navegador (o el configurado por el usuario). Vamos a ponerlo a font-size: 75%; para simular un dispositivo con pantalla más pequeña (que usará una letra más pequeña). Para ver cómo funciona la unidad em vamos a poner en el contenedor padre un tamaño de fuente diferente: font-size: 0.5rem;. Como los elementos hijos usan rem siguen con las mismas dimensiones, pero sus textos han heredado el nuevo tamaño de fuente definido en el padre. Para que el diseño mantenga la proporción correcta, cambia los rem por em en todos sus elementos hijos.

111.body:
Las imágenes normalmente no van a tener las dimensiones exactas para que encajen en el diseño, el cual además puede tener dimensiones variables si es responsivo. Para asegurar que las imágenes grandes no desbordan o creen barras de scroll, se añade la siguiente regla CSS para todos los img: &lt;body&gt; &lt;figure&gt; &lt;img alt="Imagen grande" src="https://upload.wikimedia.org/wikipedia/commons/c/cf/1_6E9A4589.jpg"&gt; &lt;figcaption&gt;Imagen más grande que el contenedor&lt;/figcaption&gt; &lt;/figure&gt;
&lt;/body&gt; img { max-width: 100%; display: block;
}
figure { border: 10px solid green; width: 15rem; text-align: center; font-family: sans-serif;
}

112.body:
Además de hacer diseños que se adaptan al espacio disponible, hay situaciones en las que es mejor tener un diseño con diferente disposición de los contenidos. Por ejemplo: para pantallas muy grandes o muy pequeñas, cuando el dispositivo está en una orientación diferente, si la pantalla es táctil, etc. Para ello se utilizan "media queries" que aplican ciertas reglas CSS solo si se cumple la condición indicada: @media (condición) { reglas CSS ... }. Hay varias condiciones , las más utilizadas son min-width y max-width que consultan el ancho actual de la ventana gráfica de la página. &lt;body&gt; &lt;header class="cabecera"&gt;Cabecera&lt;/header&gt; &lt;article class="contenido"&gt;Contenido&lt;/article&gt; &lt;aside class="secciones"&gt;Secciones del sitio web&lt;/aside&gt; &lt;aside class="indice"&gt;Índice del contenido&lt;/aside&gt; &lt;footer class="pie"&gt;Pié de página&lt;/footer&gt;
&lt;/body&gt; body { display: grid; grid-template-columns: 2fr 3fr 1fr; grid-template-areas: "header header header" "sections main index" "footer footer footer"; gap: 7px; padding: 12px; text-align: center; font: 12px sans-serif;
}
@media (max-width: 25em) { body { grid-template-columns: 1fr; grid-template-areas: "header" "sections" "index" "main" "footer"; }
}
body * { padding: 10px;
}
.cabecera { background: tomato; grid-area: header;
}
.pie { background: lightgreen; grid-area: footer;
}
.contenido { text-align: left; background: deepskyblue; grid-area: main;
}
.secciones { background: gold; grid-area: sections;
}
.indice { background: hotpink; grid-area: index;
} ⁉️ Ejercicio: En el ejemplo anterior, localiza la "media query" e intenta explicar qué hace. Otra unidad relativa ampliamente utilizada es %: porcentaje relativo a la misma propiedad en el elemento padre. Por ejemplo, un elemento con font-size: 50%; tendrá un tamaño de letra la mitad de pequeño que el de su padre. Cada navegador tiene un tamaño de letra razonable para las dimensiones del dispositivo en el que se ejecuta. Además, el usuario puede establecer otro tamaño que se ajuste más a sus necesidades. Utilizar este tamaño como referencia para la página web suele ser lo más adecuado.

114.body:
Una web puede tener muchos estilos, que deberán ser consistentes cuando cambien. Para facilitar su mantenimiento, se han creado herramientas que permiten escribir las reglas de forma más modular o programática. La más usada es Sass que utiliza la sintaxis SCSS (.scss) para extender el lenguaje CSS. Los navegadores solo entienden CSS, por lo que para usar estas extensiones es necesario pre-procesar (o compilar) sus ficheros y convertirlos a CSS antes de desplegar la web [1] . Algunas de las características de Sass son similares a otras de CSS: Variables SCSS /* SCSS */
$fuente-principal: Helvetica, sans-serif;
p { font: 100% $fuente-principal; } Variables CSS /* CSS */
html { --fuente-principal: Helvetica, sans-serif; }
p { font: 100% var(--fuente-principal); } Selector de hijos SCSS /* SCSS */
nav { li { display: inline-block; }
} Selector de hijos CSS /* CSS */
nav li { display: inline-block; } Módulos SCSS /* SCSS: hay otro fichero _base.scss */
@use 'base';
/* Aquí otras reglas SCSS */ Módulos CSS /* CSS: hay otro fichero base.css */
@import 'base.css';
/* Aquí otras reglas CSS */ Herencia SCSS /* SCSS */
%message-common { border: 1px solid #ccc; padding: 10px; color: #333;
}
.mensaje { @extend %message-common;
}
.exito { @extend %message-common; border-color: green;
}
.error { @extend %message-common; border-color: red;
} Herencia CSS /* CSS */
.mensaje, .exito, .error { border: 1px solid #ccc; padding: 10px; color: #333;
}
.exito { border-color: green; }
.error { border-color: red; } Operaciones SCSS /* SCSS */
$ancho-inicial: 30em;
div { width: $ancho-inicial + 2em; } Operaciones CSS /* CSS */
html { --ancho-inicial: 30em; }
div { width: calc(var(--ancho-inicial) + 2em); } Estas otras características solo son posibles gracias al pre-procesado : Interpolación SCSS $pantallas-pequeñas: 36em;
@media (max-width: #{$pantallas-pequeñas}) { /* reglas para pantallas pequeñas */ p { font-size: 150%; }
} Mixins SCSS @mixin theme($theme: darkgray) { background: $theme; box-shadow: 0 0 1px rgba($theme, .25); color: #fff;
}
.info { @include theme; }
.alerta { @include theme($theme: darkred); }
.exito { @include theme($theme: darkgreen); } Funciones SCSS @function mas-verde($color) { @return $color + rgb(0,50,0);
}
p { background: mas-verde(gray); } Directivas de control $debug: true;
article { color: black; /* Para comprobar el diseño resaltando los bordes */ @if ($debug) { border: 1px dotted red; }
} &lt;body&gt;
&lt;p&gt;Este es un ejemplo de SCSS mixin con el que puedes jugar directamente. Puedes probar el resto de características de Sass en este Codepen.io. El mixin "ellipsis" crea bloques de texto del ancho y número de líneas indicado. Si el contenido ocupa más que el número de líneas indicado, el texto se acorta y se muestra una elipsis ("…").&lt;/p&gt;
&lt;/body&gt; @mixin ellipsis($lineas: 1, $ancho: 100%) { width: $ancho; overflow: hidden; text-overflow: ellipsis; display: -webkit-box; line-clamp: $lineas; -webkit-line-clamp: $lineas; -webkit-box-orient: vertical;
} p { @include ellipsis($lineas: 2, $ancho: 20rem); } Esto implica tener un sistema de construcción del proyecto que automatice la generación de los CSS finales.

