Los resultados se obtienen transformando un "stream" de eventos (datos) y propagando (reaccionando a) los cambios automáticamente. Máximo valor en lista de enteros... import { fromEvent } from "https://cdn.skypack.dev/rxjs@7.3.0";
import { scan, map } from "https://cdn.skypack.dev/rxjs@7.3.0/operators"; const output = document.querySelector("output");
const button = document.querySelector("button"); fromEvent(button, "click") .pipe(map(ev => ev.clientX), scan((total, n) => total < n ? n : total)) .subscribe((max) => { output.textContent = "Max X = " + max; }); 🔍 Nota: documentación de rxjs. Playground... &lt;button&gt;Click me in different places&lt;/button&gt;
&lt;output&gt;&lt;/output&gt; import { fromEvent } from "https://cdn.skypack.dev/rxjs@7.3.0";
import { scan, map } from "https://cdn.skypack.dev/rxjs@7.3.0/operators";
const output = document.querySelector("output");
const button = document.querySelector("button");
fromEvent(button, "click") .pipe(map(ev =&gt; ev.clientX), scan((total, n) =&gt; total &lt; n ? n : total)) .subscribe((max) =&gt; { output.textContent = "Max X = " + max; });

