La etiqueta <a href="{URL}">texto o bloque</a> permite: navegar a otra web (con una URL absoluta), a otra página dentro de la web actual (con una URL relativa) o a un elemento de la página actual (indicando el #fragmento). Crea los 3 enlaces indicados en los comentarios del siguiente HTML: #contenido { margin:120px 0 120px 0; } &lt;body&gt;
&lt;h1&gt;Navegación&lt;/h1&gt;
&lt;!-- 1. Enlace al elemento cuyo id es "contenido" --&gt;
&lt;a&gt;Contenido&lt;/a&gt;
&lt;!-- 2. Enlace absoluto a https://en.wikipedia.org/wiki/Hyperlink --&gt;
&lt;a&gt;Externo&lt;/a&gt;
&lt;!-- 3. Enlace relativo a ./dir/file.html --&gt;
&lt;a&gt;Interno&lt;/a&gt; <p id="contenido">Este elemento puede enlazarse utilizando su id en el fragmento de la URL: #contenido</p> <a href="#">Volver arriba</a> </body> 🔍 Nota: Para volver tras pulsar tus enlaces, dale al botón "Rerun". Los enlaces relativos pueden ser al dominio [1] o al path actual: Para que un enlace se abra en una nueva pestaña o ventana del navegador se utiliza el atributo target="_blank". Algunos enlaces pueden tener un protocolo diferente a HTTP. Al pulsarlo se abrirá la aplicación del SO asociada a dicho protocolo [2] si la hubiera. Por ejemplo, usando este se abrirá el programa de correo electrónico: href="mailto:usuario@email.com?subject=Asunto&body=Contenido" ⁉️ Ejercicio: Modifica uno de los enlaces anteriores para que se abra en una ventana/pestaña nueva, y otro para que al pulsar se redacte un correo. El enlace relativo del primer ejercicio lo es al dominio en el que se encuentra alojado que es Codepen.io, donde probablemente no exista el fichero ./dir/file.html. Existen muchos otros protocolos o esquemas URI que podrían utilizarse potencialmente en un enlace.

