Permiten crear un interfaz de usuario para que éste envíe información al servidor. Vamos a crear uno para hacer un pedido de un producto genérico. El formulario tendrá los siguientes controles: Un grupo de campos conteniendo el nombre, teléfono y correo-e del cliente, solo el último obligatorio. Otro grupo de campos con las características del producto: modelo, tamaño, color, cantidad y extras, todos obligatorios menos el último. Otro grupo de campos con las preferencias de entrega: fechas e instrucciones, opcionales. Otro grupo de controles para enviar y limpiar el formulario. Completa el HTML siguiente utilizando las etiquetas <input> del tipo adecuado, <select> y <textarea>. 🔍 Nota: Puedes consultar la documentacion de cada elemento en la web Mozilla . &lt;body&gt;
&lt;form action="URL absoluta o relativa" method="get o post"&gt; &lt;fieldset&gt; &lt;legend&gt;Datos personales&lt;/legend&gt; &lt;p&gt; &lt;label for="name_id"&gt;Nombre:&lt;/label&gt;&lt;br&gt; &lt;!-- Campo de texto --&gt; &lt;/p&gt; &lt;p&gt; &lt;label for="phone_id"&gt;Teléfono:&lt;/label&gt;&lt;br&gt; &lt;!-- Campo de teléfono --&gt; &lt;/p&gt; &lt;p&gt; &lt;label for="email_id"&gt;Email:&lt;/label&gt;&lt;br&gt; &lt;!-- Campo de email obligatorio --&gt; &lt;/p&gt; &lt;/fieldset&gt; &lt;fieldset&gt; &lt;legend&gt;Producto&lt;/legend&gt; &lt;p&gt; &lt;label for="model_id"&gt;Modelo:&lt;/label&gt;&lt;br&gt; &lt;!-- Menú con 1 opción seleccionable de entre estas: Modelo 1, Modelo 2 y Modelo 3 --&gt; &lt;/p&gt; &lt;p&gt;Tamaño: &lt;ul&gt; &lt;li&gt; &lt;!-- Opción excluyente obligatoria --&gt; &lt;label for="size-1_id"&gt;S&lt;/label&gt; &lt;/li&gt; &lt;li&gt; &lt;!-- Opción excluyente obligatoria --&gt; &lt;label for="size-2_id"&gt;M&lt;/label&gt; &lt;/li&gt; &lt;li&gt; &lt;!-- Opción excluyente obligatoria --&gt; &lt;label for="size-3_id"&gt;L&lt;/label&gt; &lt;/li&gt; &lt;/ul&gt; &lt;/p&gt; &lt;p&gt; &lt;label for="color_id"&gt;Color:&lt;/label&gt;&lt;br&gt; &lt;!-- Campo de color obligatorio --&gt; &lt;/p&gt; &lt;p&gt; &lt;label for="amount_id"&gt;Cantidad:&lt;/label&gt;&lt;br&gt; &lt;!-- Campo numérico con valor mínimo 1 y máximo 5 obligatorio --&gt; &lt;/p&gt; &lt;p&gt;Extras: &lt;ul&gt; &lt;li&gt; &lt;!-- Casilla de verificación --&gt; &lt;label for="extra-1_id"&gt;Extra 1&lt;/label&gt; &lt;/li&gt; &lt;li&gt; &lt;!-- Casilla de verificación --&gt; &lt;label for="extra-2_id"&gt;Extra 2&lt;/label&gt; &lt;/li&gt; &lt;li&gt; &lt;!-- Casilla de verificación --&gt; &lt;label for="extra-3_id"&gt;Extra 3&lt;/label&gt; &lt;/li&gt; &lt;/ul&gt; &lt;/p&gt; &lt;/fieldset&gt; &lt;fieldset&gt; &lt;legend&gt;Entrega&lt;/legend&gt; &lt;p&gt; &lt;label for="fecha_id"&gt;Fecha:&lt;/label&gt;&lt;br&gt; &lt;!-- Campo de fecha con valor minimo la fecha de hoy --&gt; &lt;/p&gt; &lt;p&gt; &lt;label for="instructions_id"&gt;Instrucciones:&lt;/label&gt;&lt;br&gt; &lt;!-- Área de texto --&gt; &lt;/p&gt; &lt;/fieldset&gt; &lt;fieldset&gt; &lt;!-- Botón para enviar --&gt; &lt;!-- Botón para resetear el formulario --&gt; &lt;/fieldset&gt;
