Seleccionan el o los elementos HTML a los que se van a aplicar los estilos [1] indicados bajo el selector. Hay 4 maneras básicas de selecionar: por identificador (#id), por atributo (elmento[atributo=valor]), por clase (.clase), o por nombre del elemento HTML (elemento). La siguiente tabla no tiene ningún estilo. Vamos a ir dándole estilo utilizando cada tipo de selector: &lt;table&gt; &lt;caption id="leyenda"&gt;Resumen de tipos de selectores&lt;/caption&gt; &lt;thead&gt; &lt;tr&gt; &lt;th&gt;&lt;/th&gt; &lt;th&gt;Tipo&lt;/th&gt; &lt;th&gt;Regla CSS&lt;/th&gt; &lt;th&gt;Elemento HTML seleccionado&lt;/th&gt; &lt;/tr&gt; &lt;/thead&gt; &lt;tbody&gt; &lt;tr class="separador"&gt; &lt;th rowspan="4"&gt;Básicos&lt;/th&gt; &lt;td&gt;Id&lt;/td&gt; &lt;td&gt;&lt;code&gt;#id1 { color: gray; }&lt;/code&gt;&lt;/td&gt; &lt;td&gt;&lt;code&gt;&amp;lt;p id="id1"&gt;Párrafo&amp;lt;/p&gt;&lt;/code&gt;&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Atributo&lt;/td&gt; &lt;td&gt;&lt;code&gt;p[title] { color: gray; }&lt;/code&gt;&lt;/td&gt; &lt;td&gt;&lt;code&gt;&amp;lt;p title="Título"&gt;Párrafo&amp;lt;/p&gt;&lt;/code&gt;&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Clase&lt;/td&gt; &lt;td&gt;&lt;code&gt;.clase1 { color: gray; }&lt;/code&gt;&lt;/td&gt; &lt;td&gt;&lt;code&gt;&amp;lt;p class="clase1"&gt;Párrafo&amp;lt;/p&gt;&lt;/code&gt;&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Nombre&lt;/td&gt; &lt;td&gt;&lt;code&gt;p { color: gray; }&lt;/code&gt;&lt;/td&gt; &lt;td&gt;&lt;code&gt;&amp;lt;p&gt;Párrafo&amp;lt;/p&gt;&lt;/code&gt;&lt;/td&gt; &lt;/tr&gt; &lt;tr class="separador"&gt; &lt;th rowspan="2"&gt;Pseudo&lt;/th&gt; &lt;td&gt;Clase&lt;/td&gt; &lt;td&gt;&lt;code&gt;a:hover { color: blue; }&lt;/code&gt;&lt;/td&gt; &lt;td&gt;&lt;code&gt;&amp;lt;a href=""&gt;Enlace&amp;lt;/a&gt;&lt;/code&gt;&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Elemento&lt;/td&gt; &lt;td&gt;&lt;code&gt;a::before { content: '🔗 '; }&lt;/code&gt;&lt;/td&gt; &lt;td&gt;&lt;code&gt;&amp;lt;a href=""&gt;Enlace&amp;lt;/a&gt;&lt;/code&gt;&lt;/td&gt; &lt;/tr&gt; &lt;tr class="separador"&gt; &lt;th rowspan="3"&gt;Otros&lt;/th&gt; &lt;td&gt;Universal&lt;/td&gt; &lt;td&gt;&lt;code&gt;* { color: blue; }&lt;/code&gt;&lt;/td&gt; &lt;td&gt;Aplica a todos los elementos del HTML&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Grupos&lt;/td&gt; &lt;td&gt;&lt;code&gt;#id1, #id2 { color: gray; }&lt;/code&gt;&lt;/td&gt; &lt;td&gt;&lt;code&gt;&amp;lt;p id="id1"&gt;Párrafo 1&amp;lt;/p&gt;&amp;lt;p id="id2"&gt;Párrafo 2&amp;lt;/p&gt;&lt;/code&gt;&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td&gt;Combinados&lt;/td&gt; &lt;td&gt;&lt;code&gt;p &gt; span { color: red; }&lt;/code&gt;&lt;/td&gt; &lt;td&gt;&lt;code&gt;&amp;lt;p&gt;Párrafo &amp;lt;span&gt;importante&amp;lt;span&gt;&amp;lt;/p&gt;&lt;/code&gt;&lt;/td&gt; &lt;/tr&gt; &lt;/tbody&gt;
&lt;/table&gt; /* Añade aquí las reglas CSS */ Pulsa en el botón CSS y añade, de una en una, las siguientes reglas, y observa los cambios: Selector por id del elemento HTML: #leyenda { color: #222; font-family: Georgia, Times, serif; font-size: 20px; font-style: italic; padding-bottom: 10px; border-bottom: 1px solid #bfbfbf; margin-bottom: 20px;
} ⁉️ Ejercicio: Identifica en el HTML a qué elemento se le está aplicando el estilo. Selector por atributo del elemento HTML: th[rowspan] { font-family: Georgia, Times, serif; font-size: 11px; writing-mode: sideways-lr; padding-right: 15px;
} ⁉️ Pregunta: Si hubieras utilizado th[rowspan="4"] ¿qué celda de la tabla hubiera cambiado?. Selector por clase del elemento HTML: .separador > td { border-top: 1px solid #bfbfbf;
} ⁉️ Pregunta: En este caso se está utilizando un selector combinado de clase y elemento hijo ¿Qué elementos de nuestro HTML se están seleccionando en este caso? Selectores por nombre del elemento HTML: table { margin: 0 auto; border-collapse: collapse; border-spacing: 0;
}
