}
tr:nth-child(2n+1) > td { background: #eee;
} ⁉️ Ejercicio: La última regla CSS utiliza una pseudo-clase que veremos en la siguiente sección. Intenta modificar ese selector para que aplique a las líneas pares en vez de las impares. 🔍 Nota: Desde el navegador puedes inspeccionar cada elemento, modificar sus estilos y ver los cambios directamente reflejados: Botón derecho sobre el elemento ➜ Inspeccionar ➜ Inspector (CSS). Para obtener el selector CSS de un elemento: Inspector (HTML) ➜ botón derecho sobre el código HTML del elemento ➜ Copiar ➜ Selector CSS. Lista completa de propiedades de estilo disponibles en CSS.

