Hay otros selectores que aplican a partes específicas de un elemento HTML. Por ejemplo, la primera letra, la primera línea, antes o después del elemento, etc. Esas partes se llaman pseudo-elementos y se utilizan así: selector::pseudo-elemento { ... }. &lt;blockquote&gt;Estamos dando estilo a una cita importante sobre CSS&lt;/blockquote&gt; blockquote { font-family: Georgia, serif; font-size: 19px; font-style: italic; background: #eee; margin: 19px; padding: 19px; border-radius: 19px;
}
blockquote::first-letter, blockquote::after { font-size: 29px; font-weight: 800;
}
blockquote::after { content: '❞';
} ⁉️ Ejercicio: Añade estas comillas ❝ al principio de la cita utilizando solo CSS.

97.body:
Un elemento HTML se pinta como un cuadro compuesto de: contenido, relleno (padding), borde y margen. &lt;body&gt;&lt;p&gt;
El &lt;strong&gt;contenido&lt;/strong&gt; de este elemento HTML es este texto que estás leyendo. El &lt;strong&gt;padding&lt;/strong&gt; es el espacio en color blanco de 35 píxeles que hay desde el cuadro del contenido hasta el recuadro verde (arriba, abajo, a la izquieda y a la derecha). El &lt;strong&gt;borde&lt;/strong&gt; es el recuadro verde que tiene un ancho de 10 píxeles. Por último, el &lt;strong&gt;margen&lt;/strong&gt; es el espacio en gris de 40 píxeles que hay entre el borde verde y el límite de la ventana (arriba, a la izquieda y a la derecha). Si no se indica su ancho y alto, el elemento HTML ocupa todo el ancho de su elemento padre contenedor, que en este caso es el &lt;code&gt;body&lt;/code&gt;. Por eso, cuando cambia el ancho de la ventana, el elemento reajusta el contenido manteniendo las dimensiones del padding, borde y margen.
&lt;/p&gt;&lt;/body&gt; body { background-color: gray; }
p { background-color: white; border: 10px solid green; padding: 25px; margin: 40px;
} Añade un width: 140px; al elemento en la CSS y comprueba que deja de extenderse a lo ancho de su elemento padre, y su contenido se reajusta hacia abajo. Añade un height: 140px; al elemento en la CSS y comprueba que deja de extenderse a lo alto de su elemento padre. Al fijarse todas las dimensiones del elemento, el contenido no tiene por donde crecer y desborda. Añade un overflow: hidden; al elemento en la CSS y comprueba deja de desbordar pero no se ve todo el texto. Modifica el overflow: scroll; y comprueba que ahora puedes ver todo el texto.

98.body:
Hay tres tipos principales de comportamiento visual del cuadro de un elemento HTML: Los de tipo block empiezan siempre en una nueva línea y tenderán a ocupar todo el ancho de su elemento contenedor. Ejemplos de elementos que por defecto usan este tipo: p, h1, li, section, etc. Los de tipo inline no empiezan una nueva línea y crecen a lo ancho en función de su contenido (las propiedades width y height no funcionan en ellos). Ejemplos de elementos que por defecto usan este tipo: a, strong, span, etc. Los de tipo inline-block son como los anteriores pero las propiedades width y height sí funcionan. El elemento img tiene por defecto este comportamiento. El comportamiento por defecto de cada elemento se puede cambiar con la propiedad CSS display. &lt;body&gt;
&lt;div id="e1"&gt;Elemento 1&lt;/div&gt;
&lt;div id="e2"&gt;Elemento 2&lt;/div&gt;
&lt;div id="e3"&gt;Elemento 3&lt;/div&gt;
&lt;div id="e4"&gt;Elemento 4&lt;/div&gt;
&lt;div id="e5"&gt;Elemento 5&lt;/div&gt;
&lt;/body&gt;
div { color: white; background-color: blueviolet; border: 3px solid indigo; padding: 10px; margin: 10px;
}
#e2 { display: inline-block; height: 95px; width: 150px; }
#e3 { display: inline; height: 95px; width: 150px; }
#e4 { display: inline-block; } ⁉️ Ejercicio: Identifica qué tipo de "display" (block, inline o inline-block) está usando cada uno de los anteriores elementos. ⁉️ Ejercicio: Modifica el display: none; del "Elemento 3", y luego añade la propiedad CSS visibility: hidden; al "Elemento 2". Intenta explicar la diferencia entre ambas propiedades.
